using namespace std;

int num_words(string s){
    int n=s.length();
    if(n==0 || n==1) return 0;
    int words=1;
    for(int i=0;i<n;i++)
        if(isupper(s[i])) words++;
    return words;
}


int main(){
    string s="";
    if(s.length()>pow(10,5)){cout<<"length";return 0;
	} 
    cout<<num_words(s);
    return 0;
}

